        #region Utility

        
        private DataTable buildMapTable(string qnum)
        {
            DataTable answer = new DataTable(qnum);

            DataColumn dc1 = new DataColumn("Qnum",typeof(string));
            DataColumn dc2 = new DataColumn("Year", typeof(string));
            DataColumn dc3 = new DataColumn("AllorPerYear", typeof(string));
            DataColumn dc4 = new DataColumn("MapDivText", typeof(string));            

            answer.Columns.AddRange(new DataColumn[]{ dc1, dc2, dc3, dc4 });

            return answer;
        }
        private DataTable buildJSTable(string qnum)
        {

